import { ApolloProvider } from '@apollo/client';
import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View } from 'react-native';
import apolloClient from './client';
import Routes from './src/navigation/Routes';
import { NavigationContainer } from '@react-navigation/native';
import PayPointHomeScreen from './src/screens/payment/point';
import { Button, Header, Icon } from 'react-native-elements';
import { SafeAreaProvider } from 'react-native-safe-area-context';

export default function App() {
    return (
        <ApolloProvider client={apolloClient}>
            <SafeAreaProvider>
                <Header
                    containerStyle={{ backgroundColor: '#FB8C00', borderBottomWidth: 1, height: 50 }}
                    leftComponent={
                        <Button
                            onPress={() => navigation.goBack()}
                            icon={<Icon type="font-awesome" size={30} name="angle-left" color="#FB8C00" />}
                            type="clear"
                        />
                    }
                    centerComponent={
                        <Text style={{ fontSize: 20, fontWeight: '700', color: 'white' }}>결제 페이지</Text>
                    }
                />
                <Routes />
            </SafeAreaProvider>
        </ApolloProvider>
    );
}
